import React, {Component} from 'react';
import axios from 'axios';
import SharedTable from './sharedTable';

export default class Bosses extends Component{
	constructor(props){
		super(props);
		this.state={
			data:[]
		}
	}

	componentDidMount(){
		axios.get(`https://us.api.blizzard.com/wow/boss/?locale=en_US&access_token=${process.env.REACT_APP_WOW_API_KEY}`)
		.then((res)=>{
			console.log(res)
			this.setState({data:res.data.bosses})
		})
		.catch((err)=>{
			console.log(err)
		})
	}

	render(){
		var headerNames=['Name','Health','Level','Description']
		var tdValues=['name','health','level','description']
		return(
			<SharedTable header={headerNames} dataValue={this.state.data} tdValues={tdValues} />
		)
	}
}
